import styled from "styled-components";


export const HeaderContainer = styled.div`
background : black;
color   :   white;
padding :   12px 64px;
display :   flex;
flex-direction  :   row;
justify-content :   space-between;
`;

export const HeaderSubContainer = styled.div`
color   :   white;
padding :   8px;
display :   flex;
flex-direction  :   row;
font-weight : 600;
align-items :   center;
gap     :   20px;
`;

export const SearchBar = styled.div`
background  :   #1b1b1b;
color       :   #DDDDDD;
border-radius : 128px;
padding     : 16px 32px;
border      :   1px solid #303030;
width       : 496px;
height      : 16px;
text-align  : left;
`;

export const PrimaryGlowingButton = styled.div`
background  :   #1b1b1b;
color       :   #DDDDDD;
border-radius : 128px;
padding     : 16px 32px;
border      :   1px solid #303030;
`;


function Header() {

    const svgIconStyle = {
        fill : "white",
        background  : "red"
    }


    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar>Search</SearchBar>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryGlowingButton>Account</PrimaryGlowingButton>
            <PrimaryGlowingButton>Notify</PrimaryGlowingButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
